import logo from './logo.svg';
import './App.css';
import React from "react";
import {
    BrowserRouter as Router,
    Route,
} from "react-router-dom";


class App extends React.Component {
    render() {
        return (
            <Router>
            <div>
                <img src="/images/background.jpg" alt="Logo"/>
                <button> </button>
            </div>
            </Router>
        );
    }
}
export default App;
